const GameSettings = {
    gridWidth: 10,
    gridHeight: 10,
    hexSize: { x: 10, y: 10 },
    windowSize: {
      width: 800,
      height: 600
    },
    viewBox: "-50 -50 100 100", // MinX MinY Width Height
  
